import React, { Component } from "react";
import { GoogleMap, Marker } from "react-google-maps"

function Map() {
    let map;
    const google = window.google

    let marker = ({lat: 40.7128, lng: -73.935242})

    const center = {
        lat: 40.7128,
        lng: -73.935242
    };

    function initMap(){
      map = new google.maps.Map(document.getElementById('map'), {
        center: {center},
        zoom: 10
      });

      let location = new google.maps.Marker({position: marker, map: map})
    }  

    return(
      <>
        <div id="map"></div>
        <script async defer src={`https://maps.googleapis.com/maps/api/js?key=${process.env.REACT_APP_GOOGLE_KEY}&callback=initMap`} type="text/javascript"></script>
      </>
    )
}

export default Map;
